function showUserDetails(){$(".show-detail").on("click",function(a){a.preventDefault(),$(".modal").remove();var e=$(this).attr("href");AjaxModal.call(e,function(){$("#details-user-modal").modal("show")})})}function showNewUserForm(){$(".new-user").on("click",function(a){a.preventDefault(),$(".modal").remove();var e=$(this).attr("href");AjaxModal.call(e,function(){$("#birth_date").datepicker({locale:"no",format:"yyyy-mm-dd"}),$("#new-user-modal").modal("show")})})}function initDataTable(){$("#users-table").dataTable({paging:!1,info:!1})}function massDelete(){$(".delete-selected-user").on("click",function(a){a.preventDefault();var e=$(this).attr("href"),t=[];$(".check-user:checked").each(function(){t.push($(this).data("id"))}),t.length>0&&(window.location=e+"?ids="+t.join())})}function checkForm(){$("")}var AjaxModal={};AjaxModal.call=function(a,e){self=this,$.ajax({url:a,success:function(a){self.appendModal(a),e()}})},AjaxModal.callWhithData=function(a,e,t){self=this,$.ajax({url:a,method:"POST",data:e,success:function(a){self.appendModal(a),t()}})},AjaxModal.appendModal=function(a){$("body").append(a)},$(document).ready(function(){showUserDetails(),showNewUserForm(),initDataTable(),massDelete()});